import React from 'react';
import { useState } from 'react';
import axios from 'axios';
import '../App.css';
import './FormCliente.css';
import ListarCliente from './ListarCliente';

function cliente() {
  const [nome, setNome] = useState([]);
  const [sobrenome, setSobrenome] = useState([]);
  const [cpf, setCpf] = useState([]);
  const [C, setSenha] = useState([]);


  return (
    <div>
      <div className="formCliente">
        <div className="container">
          <form action="">
            <label>Nome</label>
            <input type="text" className="nome" />
            <label>sobrenome</label>
            <input type="text" className="sobrenome" />
            <label>CPF</label>
            <input type="text" className="CPF" />
            <label>CEP</label>
            <input type="text" className="CEP" />
            <label>Endereço</label>
            <input type="text" className="Endereco" />
            <label>N°</label>
            <input type="text" className="Numero" />
            <label>Cidade</label>
            <input type="text" className="Cidade" />
            <label>Estado</label>
            <input type="text" className="Estado" />
            <button href="" className="BTM">Registrar</button>
          </form>
        </div>

      </div>
      <div className="container">
        <ListarCliente />
      </div>
    </div>
  );
}

export default cliente;
